function isLoggedIn(){return null!=f.getAuth()}function getCurrentProfile(e){return getUserProfile(getCurrentProfileId(),e)}function getUserProfile(e,t){return f.child(e).once("value",t)}function getAllProfiles(e){return f.once("value",e)}function addProfile(e,t){var r={name:$("#name").val(),surname:$("#surname").val(),email:$("#newemail").val(),website:$("#website").val(),descrp:$("#descrp").val(),imageUrl:"http://i.imgur.com/RDt7RuO.png",fotos:{foto1:t,foto2:""}};f.child(e).set(r)}function getCurrentProfileId(){console.log(f.getAuth().uid);var e=f.getAuth().uid.substring(f.getAuth().uid.indexOf(":")+1,f.getAuth().uid.length);return console.log(e),e}function updateProfile(e){f.child(getCurrentProfileId()).set(e)}function getUrlParameter(e){for(var t=window.location.search.substring(1),r=t.split("&"),n=0;n<r.length;n++){var i=r[n].split("=");if(i[0]==e)return i[1]}}var f=new Firebase("https://projectoni.firebaseio.com/");